import './Login.css';
import Dialog from '@mui/material/Dialog';
import Modal from 'react-bootstrap/Modal';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import { useState } from 'react';
import toast from 'react-hot-toast';

const Login = (props) => {
    const [loginSignUp, setLoginSignUp] = useState(true);
    const [userName, setUserName] = useState('');

    const formdata = {
        mobileNumber: '',
        password: '',
        name: '',
    };

    const [enterUserData, setEnterUserData] = useState(formdata);

    const handleForm = (e) => {
        setEnterUserData({ ...enterUserData, [e.target.name]: e.target.value });
    };

    const handleLogin = async () => {
        try {
            const response = await fetch('http://localhost:3000/login', {
                method: 'POST',
                headers: {
                    Accept: 'application/json',
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({
                    password: enterUserData.password,
                    phoneNumber: enterUserData.mobileNumber,
                }),
            });

            if (!response.ok) {
                throw new Error('Network response was not ok');
            }
            const data = await response.json();
        } catch (error) {
            console.error(
                'There was a problem with the sign-in request:',
                error
            );
        }
    };
    const handleSignin = async () => {
        try {
            const response = await fetch('http://localhost:3000/signin', {
                method: 'POST',
                headers: {
                    Accept: 'application/json',
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({
                    userName: enterUserData.name,
                    password: enterUserData.password,
                    phoneNumber: enterUserData.mobileNumber,
                }),
            });

            if (!response.ok) {
                throw new Error('Network response was not ok');
            }

            toast.success('Succesfully Signing');

            const data = await response.json();
        } catch (error) {
            console.error(
                'There was a problem with the sign-in request:',
                error
            );
        }
    };

    return (
        <>
            <Modal
                {...props}
                size="lg"
                aria-labelledby="example-modal-sizes-title-lg"
                centered
            >
                <Modal.Body style={{ padding: 0 }}>
                    <Row style={{ height: '550px', color: 'white' }}>
                        <Col
                            style={{ backgroundColor: '#2874f0' }}
                            lg={5}
                            md={5}
                            sm={0}
                            xs={0}
                        >
                            <div className="contanerFirst">
                                {loginSignUp ? (
                                    <>
                                        <h3>Login</h3>
                                        <p>
                                            Get access to your Orders, Wishlist
                                            and Recommendations
                                        </p>
                                    </>
                                ) : (
                                    <>
                                        {' '}
                                        <h3>Looks like you're new here!</h3>
                                        <p>
                                            Sign up with your mobile number to
                                            get started
                                        </p>
                                    </>
                                )}
                            </div>
                        </Col>
                        <Col lg={7} md={7} sm={12} xs={12}>
                            <div className="inputData">
                                <TextField
                                    id="standard-basic"
                                    label="Enter Mobile number"
                                    variant="standard"
                                    size="medium"
                                    fullWidth={true}
                                    name="mobileNumber"
                                    onChange={(e) => {
                                        handleForm(e);
                                    }}
                                />
                                <TextField
                                    style={{ marginTop: '20px' }}
                                    id="standard-basic"
                                    label="Enter Password"
                                    variant="standard"
                                    size="medium"
                                    fullWidth={true}
                                    name="password"
                                    onChange={(e) => {
                                        handleForm(e);
                                    }}
                                />
                                {loginSignUp ? (
                                    <></>
                                ) : (
                                    <>
                                        <TextField
                                            style={{ marginTop: '20px' }}
                                            id="standard-basic"
                                            label="Enter Name"
                                            variant="standard"
                                            size="medium"
                                            fullWidth={true}
                                            name="name"
                                            onChange={(e) => {
                                                handleForm(e);
                                            }}
                                        />
                                    </>
                                )}

                                <p
                                    style={{
                                        color: 'black',
                                        marginTop: '20px',
                                    }}
                                >
                                    By continuing, you agree to Flipkart's Terms
                                    of Use and Privacy Policy.
                                </p>

                                <div className="buttonAliment">
                                    {loginSignUp ? (
                                        <>
                                            {' '}
                                            <Button
                                                style={{
                                                    backgroundColor: '#f86418',
                                                }}
                                                onClick={() => {
                                                    handleLogin();
                                                }}
                                            >
                                                Login
                                            </Button>
                                        </>
                                    ) : (
                                        <>
                                            {' '}
                                            <Button
                                                style={{
                                                    backgroundColor: '#f86418',
                                                }}
                                                onClick={() => {
                                                    handleSignin();
                                                }}
                                            >
                                                Continue
                                            </Button>
                                        </>
                                    )}

                                    <p style={{ marginTop: '20px' }}>OR</p>
                                    {loginSignUp ? (
                                        <>
                                            {' '}
                                            <Button
                                                className="loginButton"
                                                style={{
                                                    backgroundColor: '#ffff',
                                                    marginTop: '20px',
                                                    marginBottom: '20px',
                                                    color: '#2874f0',
                                                    boxShadow:
                                                        '0 2px 4px 0 rgb(0 0 0 / 20%)',
                                                }}
                                            >
                                                Request otp
                                            </Button>
                                        </>
                                    ) : (
                                        <>
                                            <Button
                                                className="loginButton"
                                                style={{
                                                    backgroundColor: '#ffff',
                                                    marginTop: '20px',
                                                    marginBottom: '20px',
                                                    color: '#2874f0',
                                                    boxShadow:
                                                        '0 2px 4px 0 rgb(0 0 0 / 20%)',
                                                }}
                                                onClick={() => {
                                                    setLoginSignUp(true);
                                                }}
                                            >
                                                Existing User? Log in
                                            </Button>
                                        </>
                                    )}

                                    {loginSignUp ? (
                                        <>
                                            {' '}
                                            <p
                                                onClick={() => {
                                                    setLoginSignUp(false);
                                                }}
                                            >
                                                New to flipcart? Create an
                                                account
                                            </p>
                                        </>
                                    ) : (
                                        <></>
                                    )}
                                </div>
                            </div>
                        </Col>
                    </Row>
                </Modal.Body>
            </Modal>
        </>
    );
};

export default Login;
